import React, { Component } from "react";
const countOfStars = 1000;
export default class SkyBanner extends Component {
  render() {
    return (
      <div className="sky">
        {[...Array(countOfStars).keys()].map(item => {
          return <div className={`star star-${item}`} />;
        })}
      </div>
    );
  }
}
